Glee is een Amerikaanse, komische en muzikale televisieserie uit 2009 van Fox.
Het verhaal draait om een groep jongeren die, onder leiding van hun leerkracht, een koor beginnen op hun school.
Dit is de fictieve William McKinley High School in Lima (Ohio).
